import React from "react";
import logo from './logo.png';
function header(){
    return(
    <div className="container-fluid">
    <div className='container-lg clearfix'>
        {/* <div className="top-head clearfix"> */}
            <div className='row col-sm-8'>
              <div className='mail-block block col-sm-4'>
                <i class="fa fa-envelope" aria-hidden="true"></i>
                <a href='#'>info@tiarainfrastructure.com</a>
              </div>
              <div className='mail-block block col'>
                <i class="fa fa-phone" aria-hidden="true"></i>
                <a href='#'>+91 7314995740</a>
              </div>
              <div className='mail-block block col-sm-5'>
                <i class="fa fa-clock" aria-hidden="true"></i>
                <a href='#'>Mon to Sat: 10:30am - 06:30pm</a>
              </div>
            </div>
            {/* <div className='btn right'> */}
               <a href="#" className="btn right">ठेकेदार पंजीकरण</a>
            {/* </div> */}
          {/* </div> */}
        </div>
     </div>
    );
}
export default header;
